  sb.append(", startInode=").append(startInode);
  sb.append(", curInode=").append(curInode);
  sb.append(", ugi=").append(ugis);
  sb.append(", blockIds=").append(blockIds);
  sb.append(", offset=").append(raw.pos);
  sb.append(" }");
  return sb.toString();
}
